import React, { Component, Fragment } from 'react';
import { Input } from 'antd';
//引入css文件
import './style.css';

class DataUplode extends Component {
    render() {
        return (
            <Fragment>
                <span className='secondarytitle' style={{display:inl}}>时间选择</span>
                <Input placeholder='请输入开始时间' className='data_input' />
                <Input placeholder='请输入结束时间' className='data_input' />
            </Fragment>

        )
    }
}

export default DataUplode;
